const routes = [
  { path: '/', redirect: '/login' },
  { path: '/home', component: () => import('./components/Authentification/AuthentificationUser.vue') },
  { path: '/login', component: () => import('./components/Authentification/AuthentificationUser.vue') },
];

export default routes;
